import { Tile, Box, Media, MediaContent, MediaLeft, Image } from 'bloomer';

export default function TileItem({ title, subtitle }) {
    return (
        <Tile isParent>
            <Tile
                title={ title }
                subtitle={ subtitle }
                isChild
                render={
                    props => (
                        <Box {...props}>
                            <Media>
                                <MediaLeft>
                                    <Image />
                                </MediaLeft>
                            </Media>
                        </Box>
                    )
                }
            />
        </Tile>
    );
}
